import React from "react";
import {
    BarChart,
    Bar,
    Cell,
    XAxis,
    YAxis,
    CartesianGrid,
    Tooltip,
    Legend,
    ResponsiveContainer,
} from "recharts";
import Chart from "../chart/Chart";
function Home() {
    return (
        <div>
            <h2>항행통신부 종합통신소 장애 관리</h2>
            <>
                <div>
                    <ResponsiveContainer width="100%" height="100%">
                        <BarChart width={150} height={40} data={data}>
                            <Bar dataKey="uv" fill="#8884d8" />
                        </BarChart>
                    </ResponsiveContainer>
                </div>
            </>
        </div>
    );
}

export default Home;
